import{_ as e}from"./chunks/teamone_formula.bbed24ce.js";import{_ as t,o as a,c as o,Q as n}from"./chunks/framework.6e0d310a.js";const s="/teamone/img/functions/teamone_formula.png",l="/teamone/img/functions/quite_mode.png",i="/teamone/img/functions/default_elements.png",r="/teamone/img/functions/alternative_hierarchy.png",u="/teamone/img/functions/teamone_formula_insert.png",_=JSON.parse('{"title":"Formulas","description":"","frontmatter":{},"headers":[],"relativePath":"doc/formulas.md","filePath":"doc/formulas.md"}'),m={name:"doc/formulas.md"},c=n('<h1 id="formulas" tabindex="-1">Formulas <a class="header-anchor" href="#formulas" aria-label="Permalink to &quot;Formulas&quot;">​</a></h1><h2 id="teamone-function" tabindex="-1">TEAMONE() function <a class="header-anchor" href="#teamone-function" aria-label="Permalink to &quot;TEAMONE() function&quot;">​</a></h2><p><em><strong>TEAMONE()</strong></em> function is a simple formula approach to retrieve data from IBM Planning Analytics. It expects the next arguments:</p><ul><li><em><strong>cubeName</strong></em> - the cube name to retrieve data from</li><li><em><strong>rangeRows</strong></em> - select the cells represeting your rows</li><li><em><strong>rangeColumns</strong></em> - select the cells represeting your columns</li><li><em><strong>rangeTitles</strong></em> - select the cells represeting your context elements</li><li><em><strong>options</strong></em> - flags to &quot;A&quot;utofit columns, &quot;R&quot;everse sign, use &quot;F&quot;ormatted values, use &quot;S&quot;tatic values, &quot;Q&quot;uiet mode. You can combine flags: &quot;AFSQ&quot; - fetch formatted static values, autofit columns and quite mode.</li></ul><p><img src="'+s+`" alt="img" data-zoomable=""></p><p>For rows and columns you can select multiple cells, a single cell or even no cells (use an empty string or leave the argument empty):</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">// Retrieve data from Revenue cube, use formatted values and autofit columns</span></span>
<span class="line"><span style="color:#e1e4e8;">=TEAMONE(&quot;Revenue&quot;, A4:A5, B2:C3, A2:A3,&quot;AF&quot;)</span></span>
<span class="line"><span style="color:#e1e4e8;"></span></span>
<span class="line"><span style="color:#e1e4e8;">// No columns (argument #3 is skipped), hardcoded title element</span></span>
<span class="line"><span style="color:#e1e4e8;">=TEAMONE(&quot;Revenue&quot;, A4:A5, , &#39;Gross Revenue&#39;)</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">// Retrieve data from Revenue cube, use formatted values and autofit columns</span></span>
<span class="line"><span style="color:#24292e;">=TEAMONE(&quot;Revenue&quot;, A4:A5, B2:C3, A2:A3,&quot;AF&quot;)</span></span>
<span class="line"><span style="color:#24292e;"></span></span>
<span class="line"><span style="color:#24292e;">// No columns (argument #3 is skipped), hardcoded title element</span></span>
<span class="line"><span style="color:#24292e;">=TEAMONE(&quot;Revenue&quot;, A4:A5, , &#39;Gross Revenue&#39;)</span></span></code></pre></div><p>See <a href="https://docs.google.com/spreadsheets/d/1wOI8onSk2GoOoVzSDh_EPbZj5pN5iQPPK62cDV3sr7k/edit#gid=0" target="_blank" rel="noreferrer">::TEAMONE formula example</a></p><h2 id="autofit-columns" tabindex="-1">Autofit columns <a class="header-anchor" href="#autofit-columns" aria-label="Permalink to &quot;Autofit columns&quot;">​</a></h2><p>Use the &quot;A&quot; flag in the TEAMONE() function to automatically resizes columns to fit the cell in each column that has the widest content.</p><h2 id="reverse-sign" tabindex="-1">Reverse sign <a class="header-anchor" href="#reverse-sign" aria-label="Permalink to &quot;Reverse sign&quot;">​</a></h2><p>Use the &quot;R&quot; flag in TEAMONE() to automatically reverse sign for each value retrieved.</p><h2 id="formatted-values" tabindex="-1">Formatted values <a class="header-anchor" href="#formatted-values" aria-label="Permalink to &quot;Formatted values&quot;">​</a></h2><p>Use the &quot;F&quot; flag in the TEAMONE() function to retrieve formatted cube values from IBM Planning Analytics. Alternatively, you can skip this flag and apply formatting in Google Sheets.</p><h2 id="static-values" tabindex="-1">Static values <a class="header-anchor" href="#static-values" aria-label="Permalink to &quot;Static values&quot;">​</a></h2><p>When using the &quot;S&quot; flag, =TEAMONE() formula will return a single value (the very first one) and the rest of the values will be printed as static. This flag is recommended when you need to use the TEAMONE() formula with hundreds of rows and/or columns to avoid the error message <em><strong>You have exceeded the property storage quota. Please remove some properties and try again</strong></em>. However, in most cases, you will not need to use this flag.</p><h2 id="quiet-mode" tabindex="-1">Quiet mode <a class="header-anchor" href="#quiet-mode" aria-label="Permalink to &quot;Quiet mode&quot;">​</a></h2><p>If you skip some cube dimensions, TeamOne will automatically use <em><strong>default elements</strong></em> for those dimensions and will add them to the cell notes. Use the &quot;Q&quot; flag in the TEAMONE() function to disable notes with omitted dimensions.</p><p><img src="`+l+'" alt="img" data-zoomable=""></p><h2 id="repetitive-elements" tabindex="-1">Repetitive elements <a class="header-anchor" href="#repetitive-elements" aria-label="Permalink to &quot;Repetitive elements&quot;">​</a></h2><p>If you have multiple rows and/or columns, you don&#39;t have to specify repetitive elements for each row or column. TeamOne will automatically use the same element name if the next rows/columns are blank.</p><p><img src="'+e+'" alt="img" data-zoomable=""></p><h2 id="multiple-formulas-performance" tabindex="-1">Multiple formulas performance <a class="header-anchor" href="#multiple-formulas-performance" aria-label="Permalink to &quot;Multiple formulas performance&quot;">​</a></h2><p>If using the same title elements, the same row\\column dimensions and the same formula flags, TeamOne will automatically detect and build a single query for each group of similar formulas, resulting in better performance.</p><h2 id="default-elements" tabindex="-1">Default elements <a class="header-anchor" href="#default-elements" aria-label="Permalink to &quot;Default elements&quot;">​</a></h2><p>You do not need to include elements from all the cube dimensions. TeamOne will automatically select the default member for each skipped dimension and add a corresponding note to the cell.</p><p><img src="'+i+'" alt="img" data-zoomable=""></p><h2 id="alternative-hierarhies" tabindex="-1">Alternative hierarhies <a class="header-anchor" href="#alternative-hierarhies" aria-label="Permalink to &quot;Alternative hierarhies&quot;">​</a></h2><p>Use the <em><strong>dimension^hierarchy^element</strong></em> syntax to specify the dimension and hierarchy for any title element or the first element of any row\\column range. This is especially helpful when an element name is ambiguous (exists in multiple dimensions).</p><p><img src="'+r+`" alt="img" data-zoomable=""></p><h2 id="connection-name" tabindex="-1">Connection name <a class="header-anchor" href="#connection-name" aria-label="Permalink to &quot;Connection name&quot;">​</a></h2><p>Use &quot;ConnectionName:CubeName&quot; syntax to retrieve data from the specified connection.</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki github-dark vp-code-dark"><code><span class="line"><span style="color:#e1e4e8;">// Revenue cube in TeamOneTest environment</span></span>
<span class="line"><span style="color:#e1e4e8;">=TEAMONE(&quot;TeamOneTest:Revenue&quot;, A4:A5, B2:C3, A2:A3)</span></span></code></pre><pre class="shiki github-light vp-code-light"><code><span class="line"><span style="color:#24292e;">// Revenue cube in TeamOneTest environment</span></span>
<span class="line"><span style="color:#24292e;">=TEAMONE(&quot;TeamOneTest:Revenue&quot;, A4:A5, B2:C3, A2:A3)</span></span></code></pre></div><div class="tip custom-block"><p class="custom-block-title">Autogenerate formula</p><p>You can let TeamOne build (autogenerate) <em>=TEAMONE()</em> formula for you using an existing cube/view on the <em>Model</em> tab or from the exploration menu:</p></div><p><img src="`+u+'" alt="img" data-zoomable=""></p>',35),p=[c];function d(h,f,g,v,q,b){return a(),o("div",null,p)}const T=t(m,[["render",d]]);export{_ as __pageData,T as default};
